// Minified PDF worker
self.onmessage=function(e){const{type:t,data:n}=e.data;switch(t){case"parse":try{const e=parsePDFData(n);self.postMessage({success:!0,result:e})}catch(e){self.postMessage({success:!1,error:e.message})}break;default:self.postMessage({success:!1,error:"Unknown message type"})}};function parsePDFData(e){return{numPages:1,text:"PDF content processed in worker"}}
